import styled from 'styled-components'

const Outer = styled.div`
    margin-top: 100%;
    display: flex; 
    justify-content: center;
    align-items: center; 
    height: 100vh;
    width: 100%;

    .calc-wrapper{
        width: 400px;
        height: 600px;
    }

    .row{
        display: flex;
        width: 100%;
    }
`

export default Outer
